### Problem06
Look at the following Java code:

```java
public class Fibonacci
{
    private static int[] f = new int[51];

    public static int fibonacci(int n )
    {
        if (n==0) return 0;
        if (n==1) return 1;
        if (f[n]>0) return f[n];
        f[n]=fibonacci(n-1)+fibonacci(n-2);
        return f[n];
    }
    public static void main(String[]args)
    {
        System.out.println(fibonacci(50));
    }   
}
```

Please select the choices that are correct.

**Choices:**

a. 'f' is a global variable, but it cannot be used in the main() method because it is defined in 'private'.

b. The output of the program will be 12586269025 (which is exactly the 50th number in fibonacci array).

c. The static method is a bottum-up dynamic programming.

d. This static method is a top-down dynamic programming.

